import React from 'react';
import { Grid, Card, CardContent } from '@material-ui/core';
import Styles from './styles';

const ShowClimas = () => {
	const classes = Styles();

	return (
		<Grid item sm={4}>
			<Card className={classes.card}>
				<CardContent>
					Soy agregar1
				</CardContent>
			</Card>
		</Grid>
	);
}

export default ShowClimas;
